                      "@{Sound=https://s3.amazonaws.com/audio.oxforddictionaries.com/en/mp3/pivot_us_1.mp3; Synonyms=\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003ecentral shaft\u003c/strong\u003e, fulcrum, axis, axle, swivel, pin, hub, spindle, hinge, pintle, kingpin, gudgeon, trunnion\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003ecentre\u003c/strong\u003e, focal point, focus, central point, hub, heart, nucleus, raison d\u0027�tre, crux, keystone, cornerstone, linchpin, kingpin\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003erotate\u003c/strong\u003e, turn, revolve, spin, swivel, twirl, whirl, wheel, oscillate\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003edepend\u003c/strong\u003e, hinge, turn, centre, hang, rely, rest, be contingent\u003c/div\u003e\u003c/p\u003e\r\n\u003cDIV class=ds-list\u003e\u003cB\u003e1.\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"hub\"\u003ehub\u003c/A\u003e, \u003cA href=\"centre\"\u003ecentre\u003c/A\u003e, \u003cA href=\"heart\"\u003eheart\u003c/A\u003e, \u003cA href=\"hinge\"\u003ehinge\u003c/A\u003e, \u003cA href=\"focal+point\"\u003efocal point\u003c/A\u003e, \u003cA href=\"kingpin\"\u003ekingpin\u003c/A\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003eA large group of watercolours forms the pivot of the exhibition.\u003c/SPAN\u003e\u003c/DIV\u003e\r\n\u003cDIV class=ds-list\u003e\u003cB\u003e2.\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"axis\"\u003eaxis\u003c/A\u003e, \u003cA href=\"swivel\"\u003eswivel\u003c/A\u003e, \u003cA href=\"axle\"\u003eaxle\u003c/A\u003e, \u003cA href=\"spindle\"\u003espindle\u003c/A\u003e, \u003cA href=\"fulcrum\"\u003efulcrum\u003c/A\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003eThe pedal had sheared off at the pivot.\u003c/SPAN\u003e\u003c/DIV\u003e\r\n\u003cDIV class=ds-list\u003e\u003cB\u003e1.\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"turn\"\u003eturn\u003c/A\u003e, \u003cA href=\"spin\"\u003espin\u003c/A\u003e, \u003cA href=\"revolve\"\u003erevolve\u003c/A\u003e, \u003cA href=\"rotate\"\u003erotate\u003c/A\u003e, \u003cA href=\"swivel\"\u003eswivel\u003c/A\u003e, \u003cA href=\"twirl\"\u003etwirl\u003c/A\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003eThe boat pivoted on its central axis.\u003c/SPAN\u003e\u003c/DIV\u003e\r\n\u003cDIV\u003e\u003cB\u003epivot on something\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"rely+on\"\u003erely on\u003c/A\u003e, \u003cA href=\"depend+on\"\u003edepend on\u003c/A\u003e, \u003cA href=\"hang+on\"\u003ehang on\u003c/A\u003e, \u003cA href=\"hinge+on\"\u003ehinge on\u003c/A\u003e, \u003cB\u003ebe contingent on\u003c/B\u003e, \u003cB\u003erevolve round\u003c/B\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003ethe economic problems that pivoted on overseas trade\u003c/SPAN\u003e\u003c/DIV\u003e; Examples=\u003cp\u003eAdjust the seat so that the small of your back rests flush against it and your knees are in line with the pivot point of the pulley.\u003c/p\u003e\u003cp\u003eThese events would seem rather good evidence for the proposition that the Palestinian issue is only one of several important concerns in Middle East politics, not the pivot on which all regional events turn.\u003c/p\u003e\u003cp\u003eIf Wallace is frequently overpowered by some of the league\u0027s more gargantuan pivotmen, guarding Jermaine O\u0027Neal is Big Ben\u0027s chance to push around someone else.\u003c/p\u003e\u003cp\u003eDunc is one of the few players in the NBA with a significant go-to move; his inside pivot into the rocker step position off the glass is deadly from 12 to 15 feet.\u003c/p\u003e\u003cp\u003eThey can be raised and lowered, rotated and pivoted for the optimal working angle along their 1,575-ft.\u003c/p\u003e\u003cp\u003eThe fourth pushchair was bought a few weeks after the third pushchair after we realised that we\u0027d bought the first one without checking the front wheels were pivoted.\u003c/p\u003e\u003cp\u003eOkay, he drove a silly sports car and wore Prada trainers, but we had a proper conversation, pivoting on a number of diverse subjects, ranging from the importance of Holocaust Memorial Day to contemporary British theatre.\u003c/p\u003e; Definition=\u003cp\u003e\u003cspan class=\"ind\"\u003eThe central point, pin, or shaft on which a mechanism turns or oscillates.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eA person or thing that plays a central part in an activity or organization.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eThe person or people about whom a body of troops wheels.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eA player in a central position in a team sport.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eA movement in which the player holding the ball may move in any direction with one foot, while keeping the other (the pivot foot) in contact with the floor.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eTurn on or as if on a pivot.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eProvide (a mechanism) with a pivot; fix (a mechanism) on a pivot.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eDepend on.\u003c/span\u003e\u003c/p\u003e; Family=\u003cul\u003e\u003cli\u003epivot\u003cul\u003e\u003cli\u003epivotting\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003epivots\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003epivoting\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003epivoted\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003epivotal\u003cul\u003e\u003cli\u003epivotally\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e; Affix=\u003cdiv class=\"affix\"\u003e\u003c/div\u003e}",
