                      "@{Sound=https://s3.amazonaws.com/audio.oxforddictionaries.com/en/mp3/genuflect_us_1.mp3; Synonyms=\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003efall to one\u0027s knees\u003c/strong\u003e, get down on one\u0027s knees, bow, bow down, make obeisance, kowtow, curtsy, show reverence, show deference\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003eincline the body\u003c/strong\u003e, incline the head, make an obeisance, make a bow, nod, curtsy, drop a curtsy, bob, salaam, bend the knee, kowtow\u003c/div\u003e\u003c/p\u003e; Examples=\u003cp\u003eGive me a position, and I\u0027ll find you an expert to support it - and not just an expert but one with an institutional affiliation sounding so dignified it could make a nobleman genuflect.\u003c/p\u003e\u003cp\u003eDespite the resounding rejection of the European Constitution by French and Dutch voters, the fact is, old Europe still genuflects at the altar of socialism and collectivism.\u003c/p\u003e; Definition=\u003cp\u003e\u003cspan class=\"ind\"\u003eLower one\u0027s body briefly by bending one knee to the ground, typically in worship or as a sign of respect.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eShow deference or servility.\u003c/span\u003e\u003c/p\u003e; Family=\u003cul\u003e\u003cli\u003egenuflect\u003cul\u003e\u003cli\u003egenuflexion\u003cul\u003e\u003cli\u003egenuflexions\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003egenuflects\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003egenuflection\u003cul\u003e\u003cli\u003egenuflections\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003egenuflecting\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003egenuflected\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e; Affix=\u003cdiv class=\"affix\"\u003e\u003c/div\u003e}",
                      "@{Sound=https://s3.amazonaws.com/audio.oxforddictionaries.com/en/mp3/hone_us_1.mp3; Synonyms=\u003cp\u003e\u003cdiv class=\"exs\"\u003e\u003cstrong\u003esharpen\u003c/strong\u003e, make sharper, make sharp, whet, strop, grind, file, put an edge on\u003c/div\u003e\u003c/p\u003e\r\n\u003cDIV class=ds-list\u003e\u003cB\u003e1.\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"improve\"\u003eimprove\u003c/A\u003e, \u003cA href=\"better\"\u003ebetter\u003c/A\u003e, \u003cA href=\"polish\"\u003epolish\u003c/A\u003e, \u003cA href=\"enhance\"\u003eenhance\u003c/A\u003e, \u003cA href=\"upgrade\"\u003eupgrade\u003c/A\u003e, \u003cA href=\"refine\"\u003erefine\u003c/A\u003e, \u003cA href=\"sharpen\"\u003esharpen\u003c/A\u003e, \u003cA href=\"augment\"\u003eaugment\u003c/A\u003e, \u003cA href=\"help\"\u003ehelp\u003c/A\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003ehoning the skills of senior managers\u003c/SPAN\u003e\u003c/DIV\u003e\r\n\u003cDIV class=ds-list\u003e\u003cB\u003e2.\u003c/B\u003e \u003cSPAN class=Syn\u003e\u003cA href=\"sharpen\"\u003esharpen\u003c/A\u003e, \u003cA href=\"point\"\u003epoint\u003c/A\u003e, \u003cA href=\"grind\"\u003egrind\u003c/A\u003e, \u003cA href=\"edge\"\u003eedge\u003c/A\u003e, \u003cA href=\"file\"\u003efile\u003c/A\u003e, \u003cA href=\"polish\"\u003epolish\u003c/A\u003e, \u003cA href=\"whet\"\u003ewhet\u003c/A\u003e, \u003cA href=\"strop\"\u003estrop\u003c/A\u003e\u003c/SPAN\u003e \u003cSPAN class=illustration\u003efour grinding wheels for honing fine-edged tools\u003c/SPAN\u003e\r\n\u003cDIV class=runseg\u003eUsage:\u0026nbsp;\u003cI\u003eHone\u003c/I\u003e is sometimes wrongly used where \u003cI\u003ehome\u003c/I\u003e is meant: \u003cI\u003ethis device makes it easier to home in on \u003c/I\u003e(not \u003cI\u003ehone in on\u003c/I\u003e) \u003cI\u003ethe target\u003c/I\u003e.\u003c/DIV\u003e\u003c/DIV\u003e; Examples=\u003cp\u003eIn a small wooden case hanging from the cart, there are knife stones, sand paper and a special tool for honing the edge of new knives.\u003c/p\u003e\u003cp\u003eSix people win places there in order to hone and practise their skills, with a view to appearing in the televised final round, at which one will win the big competition.\u003c/p\u003e\u003cp\u003eHe promptly resigned his job in London and took himself off to an orchard in Sussex where, in a disused railway carriage, he worked on honing his body for the biggest test of his career.\u003c/p\u003e\u003cp\u003eJust like my mother can hone in on my weak points with GPS accuracy, teenagers can humiliate me with a muttered monosyllable.\u003c/p\u003e; Definition=\u003cp\u003e\u003cspan class=\"ind\"\u003eSharpen (a blade)\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eRefine or perfect (something) over a period of time.\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eGive greater strength or firmness to (the body or a part of the body)\u003c/span\u003e\u003c/p\u003e\u003cp\u003e\u003cspan class=\"ind\"\u003eA whetstone, especially one used to sharpen razors.\u003c/span\u003e\u003c/p\u003e; Family=\u003cul\u003e\u003cli\u003ehone\u003cul\u003e\u003cli\u003ehoning\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003ehones\u003c/li\u003e\u003c/ul\u003e\u003cul\u003e\u003cli\u003ehoned\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e; Affix=\u003cdiv class=\"affix\"\u003e\u003c/div\u003e}",
